insert into article (title, created_at, body, img_illustration_b64) values (
   'Notre première sortie !',
    '2024-03-10 09:00:00',
   'Chers membres et amis du Club d''Aqua Poney de l''Écume Enchantée,

Nous sommes ravis de partager avec vous le récit de notre toute première sortie officielle ! Le samedi dernier, sous un magnifique soleil printanier, nos cavaliers et poneys ont vécu une expérience inoubliable en participant à notre sortie inaugurale.

Une Journée Mémorable
Le rendez-vous était donné dès 9 heures du matin au club. Après un chaleureux accueil et un petit-déjeuner convivial, nous avons préparé nos poneys pour une aventure unique. Nos membres, jeunes et moins jeunes, étaient tous excités à l''idée de passer une journée exceptionnelle en compagnie de nos amis à quatre pattes.

Découverte de la Nature
Notre parcours nous a conduits à travers des sentiers pittoresques bordés de fleurs sauvages, jusqu''à un magnifique lac où nous avons pu pratiquer l''aqua poney en pleine nature. Voir nos poneys nager joyeusement dans l''eau claire, tout en portant fièrement leurs cavaliers, était un spectacle à couper le souffle.

Activités et Jeux
Après la baignade, nous avons organisé plusieurs jeux aquatiques qui ont ravi les participants. Les sourires et les rires étaient omniprésents, créant une ambiance de joie et de camaraderie. Nos poneys ont également montré leur enthousiasme en participant activement à toutes les activités.

Pique-Nique et Détente
Vers midi, nous avons pris une pause bien méritée pour un pique-nique au bord du lac. Chacun avait apporté des mets délicieux à partager, et ce moment de détente a renforcé les liens entre tous les membres du club. Les enfants ont profité de ce temps libre pour caresser et nourrir les poneys, créant ainsi des souvenirs précieux.

Retour au Club
La journée s''est terminée par une promenade tranquille de retour au club, où nous avons pris soin de nos poneys après cette belle journée d''exercice et de plaisir. Les membres se sont quittés avec des étoiles dans les yeux et une impatience palpable pour la prochaine sortie.'
,
''
);

insert into article (title, created_at, body, img_illustration_b64) values (
'Inscriptions Ouvertes pour la Rentrée de Septembre 2024 !',
'2024-05-10 09:00:00',
'Chers membres et futurs cavaliers,

Nous sommes ravis d''annoncer l''ouverture des inscriptions pour la rentrée de septembre 2024 au Club d''Aqua Poney de l''Écume Enchantée ! Que vous soyez un nouveau venu ou un membre de longue date, nous avons hâte de vous accueillir pour une nouvelle saison pleine de découvertes, de jeux et de moments inoubliables avec nos adorables poneys aquatiques.

Pourquoi Rejoindre Notre Club ?
Notre club offre une expérience unique alliant équitation et natation, adaptée à tous les âges et niveaux. Que vous soyez débutant ou cavalier confirmé, nos cours sont conçus pour vous faire progresser tout en vous amusant. Voici ce que nous proposons :

Cours d''Aqua Poney : Débutant, intermédiaire ou avancé, chaque niveau trouvera des séances adaptées pour apprendre et s''améliorer.
Stages et Camps : Pendant les vacances scolaires, offrez à vos enfants une expérience enrichissante avec nos stages et camps d''aqua poney.
Événements et Compétitions : Participez à nos compétitions amicales et à nos événements spéciaux pour rencontrer d''autres passionnés et montrer vos talents.
Nos Installations
Notre club dispose d''installations modernes et sécurisées, comprenant :

Piscine Spécialisée : Une piscine adaptée à la pratique de l''aqua poney, avec des zones de sécurité pour les cavaliers et les poneys.
Écuries Confortables : Des écuries bien équipées pour garantir le bien-être de nos poneys.
Espaces de Détente : Des aires de repos et de pique-nique pour profiter de moments conviviaux en famille ou entre amis.
Comment S''inscrire ?
Les inscriptions pour la rentrée de septembre 2024 sont désormais ouvertes ! Pour vous inscrire, il vous suffit de :

Remplir le formulaire d''inscription disponible sur notre site web.
Choisir le créneau horaire et le niveau de cours qui vous conviennent.
Nous envoyer le formulaire par email ou le déposer directement au club.',

''
);
